import {useRef} from "react";

function Tree_1() {
    const div = useRef(null);

    setTimeout(()=>console.log(div.current), 200)
    return (
        <div ref={div} className="Tree_1">
            <img id={"tree_1"} src="/Icons/Landscape/tree_1.png"/>
        </div>
    )
}
export default Tree_1;
